def aupton(nn):
    ans, f, g, k = dict(), 2, 1, 0
    while len(ans) < nn:
        sf = str(f)
        for i in range(1, len(sf)+1):
            if int(sf[:i]) > nn:
                break
            if sf[:i] not in ans:
                ans[sf[:i]] = f
        f, g, k = g, f+g, k+1
    return [int(ans[str(i)]) for i in range(1, nn+1)]
